import React, { FC } from 'react';

interface ContentProps {
  part: string[];
  exercises: number[];
}

const Content: FC<ContentProps> = props => {
  return props.part.map((item, index) => (
    <p>
      {item} {props.exercises[index]}
    </p>
  ));
};

export default Content;
